INSERT INTO `authors` (`id`, `name`, `lastname`, `picture`, `author_file_path`, `author_file_name`, `author_file_size`, `author_content_type`, `biography`, `created`, `modified`) VALUES
(9, 'Jerónimo', 'Romero de Ávila', 'autor_nodisponible.jpg', NULL, NULL, NULL, NULL, '<p class="MsoNormal"><strong><span lang="ES">Jer&oacute;nimo Romero de &Aacute;vila</span></strong></p>\r\n<p class="MsoNormal"><span lang="ES">Seg&uacute;n dice Sanhuesa Fonseca (1999, pp. 428-430):</span></p>\r\n<p class="MsoNormal" style="margin: 6pt 0cm; line-height: 150%; text-align: justify;"><span lang="ES">Penosamente, parece que lo &uacute;nico que se sabe de Romero de &Aacute;vila es lo mismo que &eacute;l dice en la portada de su <em>Arte de canto llano y &oacute;rgano</em>; esto es, que fue &ldquo;Racionero y Maestro de melod&iacute;a de la santa Iglesia de Toledo, primada de las Espa&ntilde;as&rdquo;. Por esto, y por la fecha en que se edit&oacute; su obra, hemos de suponer que naci&oacute; en las primeras d&eacute;cadas del siglo XVIII.&nbsp;&nbsp;</span></p>', '2012-06-05 16:16:28', '2012-07-14 18:46:53'),
(10, 'Noel Antoine', 'Pluche', 'Pluche.jpg', NULL, NULL, NULL, NULL, '<p><strong>Noel Antoine Pluche</strong></p>\r\n<p><strong></strong>Seg&uacute;n la Enciclopedia Universal Ilustrada (1979, tomo 45, p. 862):</p>\r\n<p style="text-align: justify;">Escritor jansenista franc&eacute;s nacido en Reims y muerto en&nbsp;La Verene-Saint-Maur (1688 &ndash; 1761). Despu&eacute;s de haber ejercido&nbsp;alg&uacute;n tiempo la ense&ntilde;anza, orden&oacute;se de sacerdote y fue nombrado&nbsp;director del colegio de Laon, pero tuvo que dimitir... El intendente&nbsp;de Normand&iacute;a le confi&oacute; la educaci&oacute;n de su hijo [y luego] fij&oacute; su&nbsp;residencia en Par&iacute;s. Public&oacute; Spectacle de la natura..., obra en nueve&nbsp;vol&uacute;menes que fue traducida a casi todos los idiomas de Europa (Par&iacute;s&nbsp;1732; ed. castellana, Madrid 1756-58).</p>', '2012-06-05 19:20:23', '2012-07-14 19:01:36'),
(11, 'Tomás Vicente', 'Tosca', 'Tosca.jpg', NULL, NULL, NULL, NULL, '<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: 0cm; margin-bottom: 6.0pt; margin-left: 0cm; line-height: 150%;"><strong><span lang="ES">Tom&aacute;s Vicente&nbsp; Tosca</span></strong></p>\r\n<p class="MsoNormal" style="margin-top: 6.0pt; margin-right: 0cm; margin-bottom: 6.0pt; margin-left: 0cm; line-height: 150%;"><strong></strong><span style="text-align: justify;">Seg&uacute;n dice Sanhuesa Fonseca (1999, pp. 428-430):</span></p>\r\n<p class="MsoNormal" style="margin: 6pt 0cm; line-height: 150%; text-align: justify;"><span lang="ES">Tom&aacute;s Vicente Tosca naci&oacute; en Valencia el 21 de Diciembre de 1651 y muri&oacute; el 17 de Abril de 1723. A lo largo de su vida se destac&oacute; como matem&aacute;tico, arquitecto, fil&oacute;sofo y te&oacute;rico musical. Tambi&eacute;n se orden&oacute; como sacerdote ingresando a la Congregaci&oacute;n de San Felipe Neri el 31 de octubre de 1678. Finalmente fue maestro en Arte y doctor en Teolog&iacute;a por la Universidad de Valencia. En el &aacute;mbito musical public&oacute; un Tratado de m&uacute;sica especulativa y pr&aacute;ctica, con ediciones en 1710, 1715, 1717 y 1757, este &uacute;ltimo dentro del gran Compendio matem&aacute;tico en que se tratan todas las materias m&aacute;s principales de las ciencias que tratan de la cantidad (Valencia, Imp. de Joseph Garc&iacute;a, en nueve tomos). Este compendio tambi&eacute;n tuvo sucesivas ediciones debido a su gran demanda en Italia, Francia Alemania y otros pa&iacute;ses de Europa. Dentro de su variada producci&oacute;n literaria, se refiere tambi&eacute;n a la m&uacute;sica en el tomo III, libro V de su Compendium philosophicum, en donde dedica dos cap&iacute;tulos al estudio del sonido, su producci&oacute;n y propagaci&oacute;n. Tambi&eacute;n parece haber dejado una obra manuscrita que llevaba por t&iacute;tulo Orphei lira tum theoricam tum practicam musicam&hellip; La obra de Tosca fue apreciada por varias autoridades del mundo musical, entre quienes cabe destacar: Antonio Rodr&iacute;guez de Hita en su Diapas&oacute;n instructivo. Consonancias m&uacute;sica y morales (1757); Antonio Ventura Roel del R&iacute;o en sus obras Instituci&oacute;n harm&oacute;nica (1748) y Raz&oacute;n natural i cient&iacute;fica de la m&uacute;sica (1760); y por el Padre Fray Antonio Soler, en su texto Reparos m&uacute;sicos (1764).</span></p>', '2012-06-05 19:46:26', '2012-07-14 19:14:30'),
(12, 'Benito', 'Feijoo', 'Feijoo Benito.jpg', NULL, NULL, NULL, NULL, '<p><strong>Benito Feijoo</strong></p>\r\n<p><strong></strong>Seg&uacute;n se dice en Enciclopedia Universal Ilustrada Espasa-Calpe (1979, tomo&nbsp;XXIII, pp. 1159-1162):</p>\r\n<p style="text-align: justify;">Benedictino pol&iacute;grafo espa&ntilde;ol nacido en Casdemiro... el 8 de octubre de&nbsp;1676 y muerto en Oviedo el 26 de diciembre de 1764... Educaron sus&nbsp;padres al joven Feijoo y Montenegro en el temor a Dios y le inculcaron&nbsp;a las letras. A los catorce a&ntilde;os recibi&oacute; la cogulla benedictina..., sigui&oacute;&nbsp;sus estudios mon&aacute;sticos y eclesi&aacute;sticos en los colegios de Lerez.., pas&oacute;&nbsp;despu&eacute;s a desempe&ntilde;ar los cargos de pasante y lector en su monasterio de&nbsp;Samos, y m&aacute;s tarde al de San Vicente de Oviedo. All&iacute; recibi&oacute; los grados&nbsp;de licenciado y doctor en teolog&iacute;a. Poco despu&eacute;s obtuvo por oposici&oacute;n&nbsp;la c&aacute;tedra de teolog&iacute;a tomista y fue ascendido gradualmente a las otras&nbsp;superiores de la facultad, hasta llegar a ser catedr&aacute;tico de prima... La&nbsp;&eacute;poca de su mayor actividad literaria empieza al final de su profesorado.&nbsp;Al jubilarse hab&iacute;a terminado su Teatro cr&iacute;tico, y daba comienzo a la&nbsp;publicaci&oacute;n de las Cartas eruditas. En recompensa recibi&oacute;... particulares&nbsp;elogios de papa Benedicto XIV. Fernando VI le concedi&oacute; honores de&nbsp;consejero del reino, y mayor estima le manifest&oacute; Carlos III. Hubiera&nbsp;podido hacer en la corte un papel importante, pero ten&iacute;a verdadera antipat&iacute;a&nbsp;por residir en Madrid. Abarc&oacute; todos los conocimientos y todos de una&nbsp;manera profunda. Se le ha llamado el Voltaire espa&ntilde;ol, pero sin motivo.&nbsp;Era esc&eacute;ptico, pero dentro de los lindes de la fe. Combati&oacute; los vicios, la&nbsp;ignorancia, las supersticiones que se vest&iacute;an con nombres de religi&oacute;n y de&nbsp;catolicismo.</p>', '2012-06-05 20:53:09', '2012-07-14 19:25:20'),
