INSERT INTO `news` (`id`, `title`, `content`, `published`, `created`, `modified`) VALUES
(1, 'Memorias de Meserón Virtual', 'Muestran el desarrollo de la Biblioteca Virtual a través de los distintos cursos académicos transcurridos desde su nacimiento.', 1, '2013-09-01 19:02:35', '2013-09-01 19:44:43'),
(2, 'Estadísticas', 'Número de páginas servidas por la Biblioteca Virtual Musicológica Juan Meserón a lo largo de su historia, con referencia a los países.', 1, '2013-09-01 19:06:28', '2013-09-01 20:19:56'),
(3, 'Proyectos Virtuales', 'La Biblioteca Virtual Musicológica Juan Meserón pertenece al consorcio MultiMatch, un proyecto financiado por la Comisión Europea en el período 2006-2008, que pretende constituir un motor de búsqueda multilingüe y multimedia para facilitar el acceso a los contenidos digitales relacionados con ...', 1, '2013-09-01 20:11:43', '2013-09-01 20:11:43'),
(4, 'Encuestas a los usuarios', 'Informe sobre los hábitos musicales de nuestros usuarios a partir de la encuesta realizada en ...', 0, '2013-09-01 20:12:14', '2013-09-01 20:29:19');
INSERT INTO `pagetexts` (`id`, `title`, `description`, `enabled`, `created`, `modified`) VALUES
(1, '¿Quiénes somos?', '<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><strong><span style="font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">La Biblioteca Virtual Musicol&oacute;gica Juan Meser&oacute;n</span></strong><span style="font-family: ''Arial'',''sans-serif'';"> es un proyecto del Departamento de M&uacute;sica de la Escuela de Artes de la Universidad Central de Venezuela que tiene como objetivo la difusi&oacute;n v&iacute;a web de las &ldquo;fuentes para el estudio de la m&uacute;sica en Venezuela&rdquo;. Sus distintos m&oacute;dulos (libros, hemerograf&iacute;a musical venezolana, m&uacute;sica manuscrita, m&uacute;sica impresa, iconograf&iacute;a musical venezolana y trabajos acad&eacute;micos) contienen materiales de inter&eacute;s para el usuario especializado y para el p&uacute;blico en general.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">La <strong><span style="color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">BVMJM</span></strong> un proyecto de &iacute;ndole acad&eacute;mico avalado por el Consejo de Desarrollo Cient&iacute;fico y Human&iacute;stico de la Universidad Central de Venezuela y cuenta con la colaboraci&oacute;n de profesores y estudiantes de la Facultad de Humanidades y Educaci&oacute;n (Escuela de Artes y Escuela de Comunicaci&oacute;n Social) y de la Facultad de Ciencias (Escuela de Computaci&oacute;n).</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Los materiales que forman parte de la <strong><span style="color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">BVMJM</span></strong> se encuentran localizados en la Biblioteca Nacional de Venezuela, la Biblioteca de la Fundaci&oacute;n Vicente Emilio Sojo, la Biblioteca de la Universidad Central de Venezuela y el Palacio de las Academias de Venezuela.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">La<strong><span style="color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;"> BVMJM</span></strong> est&aacute; bajo la curadur&iacute;a de los profesores Hugo Quintana y Mariantonia Palacios y cuenta con un equipo de colaboradores de distintas especialidades.</span></p>', 1, NULL, '2012-09-23'),
(2, 'Donaciones', '<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Las donaciones son una de las v&iacute;as m&aacute;s importantes y valiosas para lograr el rescate de publicaciones venezolanas faltantes en las colecciones de la<strong><span style="color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;"> BVMJM</span></strong>. Muchos de los materiales que se encuentran en estos momentos a disposici&oacute;n de los usuarios han sido donados por personas e instituciones interesadas en compartirlos con el p&uacute;blico. Todo material vinculado con la m&uacute;sica en Venezuela o con m&uacute;sicos venezolanos resulta de inter&eacute;s para nosotros Si desea hacer una donaci&oacute;n, por favor p&oacute;ngase en contacto con nuestros editores, quienes gustosamente le contactar&aacute;n:</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Prof. Hugo Quintana <a href="mailto:quintana.hugo@gmail.com">quintana.hugo@gmail.com</a></span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Prof. Mariantonia Palacios <a href="mailto:mariantonia.palacios@gmail.com">mariantonia.palacios@gmail.com</a></span></p>', 1, NULL, '2012-09-23'),
(3, 'Términos de Uso', '<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><strong><span style="font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">Derechos de autor</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">La<strong><span style="color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;"> BVMJM</span></strong> es un proyecto acad&eacute;mico sin fines de lucro. La reproducci&oacute;n de esta p&aacute;gina, as&iacute; como la de las obras en ella contenidas, es igualmente permitida y gratuita, siempre y cuando se realice en un solo ejemplar para uso privado y sin fines de lucro.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Toda utilizaci&oacute;n de esta p&aacute;gina o de su contenido, diferente a la permitida, o con fines comerciales o lucrativos, requerir&aacute; de la previa y expresa autorizaci&oacute;n de la <strong><span style="color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">BVMJM</span></strong> y de los respectivos autores, seg&uacute;n el caso, se pena de constituir violaci&oacute;n a las normas de derechos de autor.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Podr&aacute;n citarse fragmentos de las obras que contiene esta p&aacute;gina, caso en el cual deber&aacute; indicarse la fuente y nombre del autor de la obra respectiva, siempre y cuando tales citas se hagan conforme a los usos honrados y en una medida justificada por el fin que se persiga.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><strong><span style="font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">C&oacute;mo citar informaci&oacute;n</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Art&iacute;culo </span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Deas, Malcolm. "&Oacute;pera italiana". Revista <em>El Zancudo</em>. A&ntilde;o V, Mes II, febrero 14 de 1880.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Publicaci&oacute;n digital en la p&aacute;gina web de la Biblioteca Virtual Musicol&oacute;gica Juan Meser&oacute;n.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">B&uacute;squeda realizada el 16 de mayo de 2012.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Libro</span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Lorente, Andr&eacute;s<em>. El por qu&eacute; de la m&uacute;sica</em>.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">Publicaci&oacute;n digital en la p&aacute;gina web de la Biblioteca Virtual Musicol&oacute;gica Juan Meser&oacute;n </span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;"><span style="font-family: ''Arial'',''sans-serif'';">B&uacute;squeda realizada el 16 de mayo de 2012.</span></p>\r\n<p class="MsoNormal" style="text-align: justify; line-height: 150%;">&nbsp;</p>', 1, NULL, '2013-04-19'),
(4, 'Créditos', '<p>&nbsp;</p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><strong><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-fareast-language: ES-VE;">Editores Generales:</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Prof. Hugo Quintana</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Prof. Mariantonia Palacios</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><strong><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-fareast-language: ES-VE;">Catalogadores:</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Prof. Giovani Mendoza</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Lic. Mariela Rivera</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Lic. Katiuska Rangel</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><strong><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-fareast-language: ES-VE;">Departamento de digitalizaci&oacute;n</span></strong><strong><span style="font-family: Arial, sans-serif;">:</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Lic. Carolina Gil</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Lic. Rodrigo</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><strong><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-fareast-language: ES-VE;">Dise&ntilde;o gr&aacute;fico</span></strong><span style="font-family: Arial, sans-serif;">:</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Lic. Teresa Sans&oacute;n</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><strong><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-fareast-language: ES-VE;">Plataforma Tecnol&oacute;gica:</span></strong><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-fareast-language: ES-VE;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Prof. Yusneyi Carballo</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Bch. Neisy Quintana</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">Bch. H&eacute;ctor Guzm&aacute;n</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><span style="font-family: Arial, sans-serif;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt;"><em><span style="font-family: Arial, sans-serif;">Este sitio Web fue desarrollado como parte del Trabajo Especial de Grado de Neisy Quintana y H&eacute;ctor Guzm&aacute;n para optar al t&iacute;tulo de Licenciados en Computaci&oacute;n de la Universidad Central de Venezuela.</span></em></p>\r\n<p>&nbsp;</p>', 1, NULL, '2012-09-23'),
(5, 'Módulo Libros', '<p>&nbsp;</p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-align: justify;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">En el&nbsp;</span><strong style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #4f6228;">M&oacute;dulo Libros</span></strong><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #4f6228;">&nbsp;</span><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">se exponen todos aquellos tratados o ensayos musicales que se difundieron o se produjeron en Venezuela durante los siglos XVII, XVIII, XIX y XX. Se incluyen aqu&iacute; libros o cap&iacute;tulos de libros que atienden &aacute;reas tem&aacute;ticas como teor&iacute;a, est&eacute;tica, did&aacute;ctica e historiograf&iacute;a musical. Adem&aacute;s se incluyen m&eacute;todos de instrumento, himnarios lit&uacute;rgicos y cancioneros populares, ceremoniales y rituales de los oficios y misas cantadas, diccionarios musicales, etc.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-align: justify;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-align: justify;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">El m&oacute;dulo se nutre de varios repositorios a saber:&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-align: justify;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">&nbsp;</span><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Wingdings; color: #222222;">&sect;<span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: ''Times New Roman''; font-size: 7pt;">&nbsp; </span></span><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">La colecci&oacute;n fundacional de la Biblioteca Nacional de Venezuela, nutrida por los textos que pertenec&iacute;an a la Biblioteca de la Universidad de Caracas y a otras instituciones y personajes de la Provincia de Venezuela, tales como la Congregaci&oacute;n de San Felipe Neri, el Convento de las Monjas Concepciones, la Librer&iacute;a (biblioteca dir&iacute;amos hoy) de San Francisco de Caracas y otras particulares como los doctores Ram&oacute;n Ignacio M&eacute;ndez y Nepomuceno Quintana,&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-indent: 3pt;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">&nbsp;</span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Wingdings; color: #222222;">&sect;<span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: ''Times New Roman''; font-size: 7pt;">&nbsp;&nbsp;</span></span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">La colecci&oacute;n Pedro Manuel Arcaya que, por su enorme volumen y universalidad, no deja de tener algunos textos de inter&eacute;s art&iacute;stico y musical. Se conform&oacute; en la primera mitad del siglo XX.&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-indent: 3pt;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">&nbsp;</span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Wingdings; color: #222222;">&sect;<span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: ''Times New Roman''; font-size: 7pt;">&nbsp;&nbsp;</span></span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">La colecci&oacute;n del eminente music&oacute;logo y americanista Francisco Kurt Lange, adquirida por la Biblioteca Nacional de Venezuela a finales del siglo XX.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-indent: 3pt;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">&nbsp;</span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Wingdings; color: #222222;">&sect;<span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: ''Times New Roman''; font-size: 7pt;">&nbsp;&nbsp;</span></span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">La colecci&oacute;n de libros y folletos de la Biblioteca Nacional de Venezuela, contentiva, entre otras muchas cosas, de textos de inter&eacute;s musical de los siglos XIX y XX.&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-indent: 3pt;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">&nbsp;</span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Wingdings; color: #222222;">&sect;<span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: ''Times New Roman''; font-size: 7pt;">&nbsp;&nbsp;</span></span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">La colecci&oacute;n de libros antiguos y raros de la Biblioteca de la Universidad Central de Venezuela.&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-indent: 3pt;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">&nbsp;</span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Wingdings; color: #222222;">&sect;<span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: ''Times New Roman''; font-size: 7pt;">&nbsp;&nbsp;</span></span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">El archivo de la Escuela de M&uacute;sica Jos&eacute; &Aacute;ngel Lamas.&nbsp;</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-indent: 3pt;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">&nbsp;</span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Wingdings; color: #222222;">&sect;<span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: ''Times New Roman''; font-size: 7pt;">&nbsp;&nbsp;</span></span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">El archivo de la Fundaci&oacute;n Vicente Emilio Sojo.</span></p>\r\n<p class="MsoNormal" style="margin-top: 0px; margin-bottom: 0.0001pt; padding-top: 0px; padding-bottom: 0px; font-family: arial, ''Gill Sans'', ''lucida grande'', helvetica, sans-serif; font-size: medium; text-indent: 3pt;"><span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">&nbsp;</span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Wingdings; color: #222222;">&sect;<span style="margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: ''Times New Roman''; font-size: 7pt;">&nbsp;&nbsp;</span></span><span style="text-indent: -18pt; margin-top: 0px; margin-bottom: 0px; padding-top: 0px; padding-bottom: 0px; font-family: Arial, sans-serif; color: #222222;">Otros archivos particulares.&nbsp;</span></p>\r\n<p>&nbsp;</p>', 0, NULL, NULL),
(11, 'Ayuda búsqueda avanzada (no cambiar)', '<p>&nbsp;</p>\r\n<p style="margin-top: 0cm; margin-right: 0cm; margin-bottom: 10.0pt; margin-left: 0cm; line-height: 150%;"><strong><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">La b&uacute;squeda avanzada</span></strong></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><span style="font-size: 11pt; line-height: 150%; font-family: Arial, sans-serif;">Permite buscar en m&aacute;s de un campo a la vez, indicando tambi&eacute;n en qu&eacute; &iacute;ndices queremos que se realice la consulta, acotando los resultados de la misma.</span></p>\r\n<p style="margin-top: 0cm; margin-right: 0cm; margin-bottom: 10.0pt; margin-left: 0cm; line-height: 150%;"><strong><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">Campos de b&uacute;squeda</span></strong><span class="apple-converted-space"><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">&nbsp;</span></span><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;"><br /> <strong><span style="text-decoration: underline;"><span>Autor:</span></span></strong></span></p>\r\n<p style="margin-top: 0cm; margin-right: 0cm; margin-bottom: 10.0pt; margin-left: 0cm; line-height: 150%;"><span style="font-size: 11pt; line-height: 150%; font-family: Arial, sans-serif;">Busca autores personales.</span></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><strong><span style="text-decoration: underline;"><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">T&iacute;tulo:</span></span></strong></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><span style="font-size: 11pt; line-height: 150%; font-family: Arial, sans-serif;">Busca por el t&iacute;tulo de la obra.</span></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><strong><span style="text-decoration: underline;"><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">Lugar:</span></span></strong></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><span style="font-size: 11pt; line-height: 150%; font-family: Arial, sans-serif;">Busca por el lugar de publicaci&oacute;n y distribuci&oacute;n.</span></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><strong><span style="text-decoration: underline;"><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">Fecha:</span></span></strong></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><span style="font-size: 11pt; line-height: 150%; font-family: Arial, sans-serif;">Busca por la fecha de publicaci&oacute;n y distribuci&oacute;n.</span></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><strong><span style="text-decoration: underline;"><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">Serie:</span></span></strong></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><span style="font-size: 11pt; line-height: 150%; font-family: Arial, sans-serif;">Busca por el t&iacute;tulo de la serie.</span></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><strong><span style="text-decoration: underline;"><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">Materia:</span></span></strong></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><span style="font-size: 11pt; line-height: 150%; font-family: Arial, sans-serif;">Busca por las materias asignadas a las obras por los bibliotecarios.</span></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><strong><span style="text-decoration: underline;"><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">Otras menciones de responsabilidad:</span></span></strong></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><span style="font-size: 11pt; line-height: 150%; font-family: Arial, sans-serif;">Busca por prologuista, editor, transcriptor, ilustrador y en el campo dedicatorio.</span></p>\r\n<p style="margin: 0cm 0cm 10pt; line-height: 150%;"><strong><span style="text-decoration: underline;"><span style="font-size: 11.0pt; line-height: 150%; font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">ISBN:</span></span></strong></p>\r\n<p style="margin-top: 0cm; margin-right: 0cm; margin-bottom: 10.0pt; margin-left: 0cm; line-height: 150%;"><span style="font-size: 11pt; line-height: 150%; font-family: Arial, sans-serif;">Busca por el N&uacute;mero Internacional Normalizado para libros.</span></p>\r\n<p style="margin-top: 0cm; margin-right: 0cm; margin-bottom: 10.0pt; margin-left: 0cm; line-height: 150%;">&nbsp;</p>\r\n<p style="margin: 0cm 0cm 10pt;"><span style="font-family: Arial, sans-serif;"><span style="font-size: 14px; line-height: 21px;"><br /></span></span></p>\r\n<p>&nbsp;</p>', 0, NULL, NULL),
(12, 'El registro de usuario (no cambiar)', '<p class="MsoNormal" style="text-align: justify;"><strong><span style="font-family: ''Arial'',''sans-serif''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128;">El registro de usuario</span></strong></p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-family: ''Arial'',''sans-serif'';">Permite contar con beneficios adicionales. Una vez el usuario est&eacute; registrado en el sitio Web, podr&aacute; crear una biblioteca personalizada dentro del espacio de la Biblioteca Virtual Musicol&oacute;gica "Juan Meser&oacute;n".</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-family: ''Arial'',''sans-serif'';">Para completar su registro tome en cuenta lo siguiente:</span></p>\r\n<p class="MsoListParagraphCxSpFirst" style="margin-left: 14.2pt; mso-add-space: auto; text-align: justify; text-indent: -14.2pt; mso-list: l0 level1 lfo1;"><!--[if !supportLists]--><span style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;">&sect;<span style="font-family: ''Times New Roman''; font-size: 7pt;">&nbsp; </span></span><!--[endif]--><span style="font-family: ''Arial'',''sans-serif'';">Debe proveer una direcci&oacute;n de correo electr&oacute;nico v&aacute;lida.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 14.2pt; mso-add-space: auto; text-align: justify; text-indent: -14.2pt; mso-list: l0 level1 lfo1;"><!--[if !supportLists]--><span style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;">&sect;<span style="font-family: ''Times New Roman''; font-size: 7pt;">&nbsp; </span></span><!--[endif]--><span style="font-family: ''Arial'',''sans-serif'';">Su nombre de usuario debe tener por lo menos 6 caracteres alfanum&eacute;ricos (letras o n&uacute;meros).</span></p>\r\n<p class="MsoListParagraphCxSpLast" style="margin-left: 14.2pt; mso-add-space: auto; text-align: justify; text-indent: -14.2pt; mso-list: l0 level1 lfo1;"><!--[if !supportLists]--><span style="font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;">&sect;<span style="font-family: ''Times New Roman''; font-size: 7pt;">&nbsp; </span></span><!--[endif]--><span style="font-family: ''Arial'',''sans-serif'';">Su contrase&ntilde;a debe tener por lo menos 8 caracteres.</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-family: ''Arial'',''sans-serif'';">Los campos marcados con un asterisco (*) son obligatorios.</span></p>', 0, NULL, NULL),
(14, 'Mapa del Sitio', '<div style="width: 33%; float: left;"><strong>M&oacute;dulos</strong><br />\r\n<ul>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Libros</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">M&uacute;sica impresa</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">M&uacute;sica manuscrita</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Trabajos acad&eacute;micos</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Iconograf&iacute;a musical venezolana</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Hemerograf&iacute;a musical venezolana</a></strong></li>\r\n</ul>\r\n</div>\r\n<div style="width: 33%; float: left;"><strong>Servicios</strong><br />\r\n<ul>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Donaciones</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">T&eacute;rminos de uso</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Cr&eacute;ditos</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Mapa del sitio</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Enlaces</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Preguntas m&aacute;s frecuentes</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Ayuda</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Contacto</a></strong></li>\r\n</ul>\r\n</div>\r\n<div style="width: 33%; float: left;"><strong>Participaci&oacute;n</strong><br />\r\n<ul>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Twitter</a></strong></li>\r\n<li><strong><a href="http://localhost/tesis/pagetexts/edit/" target="_blank">Facebook</a></strong></li>\r\n</ul>\r\n</div>', 1, '2013-06-03', '2013-06-03'),
(15, 'Contacto', '<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; text-align: center;"><span style="font-family: Arial, sans-serif;">Utilice este formulario para establecer contacto con el equipo de La Biblioteca Virtual Musicol&oacute;gica "Juan Meser&oacute;n".</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; text-align: center;"><strong><span style="font-size: 11.0pt; line-height: 115%; font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-themecolor: accent3; mso-themeshade: 128; mso-ansi-language: ES-VE; mso-fareast-language: ES-VE; mso-bidi-language: AR-SA;">Redes Sociales</span></strong></p>\r\n<center><a title="S&iacute;guenos en facebook" href="../../../pagina/construccion"><img style="vertical-align: middle;" src="../../../img/facebook_logo.jpg" alt="facebook" width="50" height="50" /></a></center>\r\n<p style="text-align: center; align: center;">&nbsp;</p>\r\n<center><a title="S&iacute;guenos en twitter" href="../../../pagina/construccion"><img style="vertical-align: middle;" src="../../../img/twitter_logo.jpg" alt="twitter" width="50" height="50" /></a></center>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="margin: 0cm 6pt 0.0001pt 0cm; line-height: 150%; text-align: center;"><strong><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-fareast-language: ES-VE;">Para quejas, dudas o comentarios dir&iacute;jase a las siguientes direcciones:</span></strong></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; background-color: white; text-align: center; background-position: initial initial; background-repeat: initial initial;"><strong><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-fareast-language: ES-VE;">Direcci&oacute;n F&iacute;sica:</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; background-color: white; text-align: center;"><span style="font-family: Arial, sans-serif; background-color: white; background-position: initial initial; background-repeat: initial initial;">Universidad Central de Venezuela, Facultad de Humanidades</span><span style="font-family: Arial, sans-serif;">&nbsp;<span style="background: white;">y Educaci&oacute;n, Av. Los Ilustres, Urb. Los Chaguaramos, Caracas, Venezuela.</span></span></p>\r\n<p style="text-align: justify;">&nbsp;</p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; background-color: white; text-align: center; background-position: initial initial; background-repeat: initial initial;"><strong><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-fareast-language: ES-VE;">Tel&eacute;fonos:</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; background-color: white; text-align: center; background-position: initial initial; background-repeat: initial initial;"><span style="font-family: Arial, sans-serif; background-color: white; background-position: initial initial; background-repeat: initial initial;">(0212) 6952832/2833</span></p>\r\n<p>&nbsp;</p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; text-align: center;"><strong><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #4f6228; mso-fareast-language: ES-VE;">Correo Electr&oacute;nico:</span></strong></p>\r\n<p class="MsoNormal" style="margin-bottom: 0.0001pt; line-height: 150%; text-align: center;"><span style="text-decoration: underline;"><span style="font-family: ''Arial'',''sans-serif''; mso-fareast-font-family: ''Times New Roman''; color: #333333; mso-fareast-language: ES-VE;"><a href="mailto:artesucv@gmail.com">artesucv@gmail.com</a></span></span></p>\r\n<p>&nbsp;</p>', 1, NULL, '2013-04-19');
